                ops.pop();
            } else {
                while (!ops.empty() && priority(s[i], ops.top())) {
                    num = operate(ops.top(), nums.top(), num);
                    ops.pop();
                    nums.pop();
                }
                ops.push(s[i]);
                nums.push(num);
                num = 0;
            }
        }
        while (!ops.empty()) {
            num = operate(ops.top(), nums.top(), num);
            ops.pop();
            nums.pop();
        }
        return num;
    }

    bool priority(char op1, char op2) {
        return (op1 == '*' || op1 == '/') && (op2 == '+' || op2 == '-');
    }

