        while (!ops.empty()) {
            int op2 = nums.top();
            nums.pop();
            int op1 = nums.top();
            nums.pop();
            char op = ops.top();
            ops.pop();
            num = applyOp(op1, op2, op);
            nums.push(num);
        }
        return nums.top();
    }
    bool hasPrecedence(char op1, char op2) {
        if (op2 == '(' || op2 == ')') return false;
        if ((op1 == '*' || op1 == '/') && (op2 == '+' || op2 == '-')) return false;
